gameTypes:
- name: "Chaos CTF"
  description: "Your team must score flag captures by taking the enemy flag and returning\
    \ it to their own flag.  If the flag carrier is killed, the flag drops to the\
    \ ground for anyone to pick up.  If your team's flag is taken, it must be returned\
    \ by carrying it back to your home base, before your team can score a flag capture.\
    \  If you are carrying both flags, you will get score a capture when you touch\
    \ your home base."
- name: "Chaos DM"
  description: "Free-for-all kill or be killed.  The player with the most frags wins."
- name: "Chaos Duel"
  description: "Duel it out with the weapons of your choice.  On offer are regular\
    \ UT2004 weapons, their Chaotic counterparts, melee weapons, and a Mappers Choice\
    \ selection.  All Duel maps have been specially designed for the gametype, but\
    \ some may be suited to a particular weapon mode.  Different gameplay options\
    \ are also on offer, such as regular 1on1 Duel and 4-way Battles."
- name: "Chaos Horde Hunters"
  description: "Invasion meets DetahMatch as players will fight monsters for the top\
    \ score. But these are not your typical monsters. To win these games you have\
    \ to kill the most monsters in this no-holds bar free for all bash!"
- name: "Chaos HyperCTF"
  description: "ntense, high-speed Chaos Hoverboard CTF, that works on any VCTF map.\
    \ Player movement speed is increased. Players spawn with rail guns and anti-gravity\
    \ belts. All vehicles are replaced with enhanced, flag-carrying hoverboards. Only\
    \ superweapons are Chaos turrets and gravity vortex launchers. Requires focus\
    \ and quick reflexes."
- name: "Chaos KOTH"
  description: "Two teams struggle over a common high ground, in a quest for the longest\
    \ total Hill time.  Keep the enemy team off the Hill while attempting to stay\
    \ their yourself in order to win."
- name: "Chaos Team KOTH"
  description: "Two teams struggle over a common high ground, in a quest for the longest\
    \ total Hill time.  Keep the enemy team off the Hill while attempting to stay\
    \ their yourself in order to win."
- name: "Chaos TeamDM"
  description: "Chaos version of the standard: Two teams duke it out in a quest for\
    \ battlefield supremacy.  The team with the most total frags wins."
mutators:
- name: "Anti-DareDevil Message"
  description: "This mut will dissable those DareDevil Messages by making the threshold\
    \ for those messages really really really long."
- name: "ChaosUT2: Evolution"
  description: "The next generation of Chaotic fun! With the return of old favorites\
    \ like the proxy mines and the grappling hook to the newer items like ERDW and\
    \ Chaos Pulse Pistol, Chaos has something for everyone!"
- name: "ChaosUT2: Weapon Arena"
  description: "Replace weapons and ammo in map with a single type. This version allows\
    \ you to use alternate ammo types of Chaos weapons."
